import axios from 'axios';

export const getEnderecoPorCep = (cep) => {
    try {

       axios.get(`https://viacep.com.br/ws/${cep}/json/`).then((res) => {
           console.log(res.data.cep);
       });

    } catch (error) {
      console.error(error);
    }
  }
